import React from 'react';

const UserTypeScreen = ({ history }) => {
	return (
		<div class="container">
			<h1>Hello World!</h1>
			<div class="row">
				<div class="col-sm-6" style="background-color:yellow;">
					<p>Lorem ipsum...</p>
				</div>
				<div class="col-sm-6" style="background-color:pink;">
					<p>Sed ut perspiciatis...</p>
				</div>
			</div>
		</div>
	);
};

export default UserTypeScreen;
